@Fredflowers323 the only controversy $FCEL needs to dip randomly for no reason at all is that tomorrow is a Wednesday and we&#39;ve had a two day spike.

But then you need to factor in the price of beans. I don&#39;t know about you, but looking at the overall situation, a can of Bush&#39;s Baked beans costs more than it did at the beginning of this year. That may not seem like much, but when you factor in the general cost basis of beans vs stocks, that leave a few fractional shares of FCEL on the table. Times that by the total population of the us buying beans vs stocks, and you can correlate it to the per capita amount  of beans vs shares purchased to the tune of approximately 1.4 million shares that WONT be purchased tomorrow. 

TLDR; Tomorrow will be red.
